import './App.css';


import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";



import { useEffect } from "react";


const App = () => {
  return (
    <div id="app">
          <BrowserRouter>
              <Routes>       
                  <Route path="/" element={<SignIn />} />
                  <Route path='/customer' element={<Customer />} />
                  <Route path="/manager" element={<Manager />} />
                  <Route path="/cashier" element={<Cashier />} />
              </Routes>
          </BrowserRouter>
    </div>
  );
};
export default App;
